        return (
            <div>
                <ul>
                    <li>
                        <Link to="/home/message/message1">message001</Link>&nbsp;&nbsp;
                    </li>
                    <li>
                        <Link to="/home/message/message2">message002</Link>&nbsp;&nbsp;
                    </li>
                    <li>
                        <Link to="/home/message/message/3">message003</Link>&nbsp;&nbsp;
                    </li>
                </ul>
                <hr />
                <Route path='/home/message/message1' component={Detail} />
            </div>
        )
    }
}
